"""## **Solution 3**
Generalised function is defined for calculating the joint velocities and joint accelerations provided
$\dot{X}, \ddot{X}$ and $J(q)$.

where,


> $\dot{X}$ is the end-effector velocity in cartesian coordinates.\
> $\ddot{X}$ is the end-effector acceleration in cartesian coordinates.\
> $J(q)$ is the velocity Jacobian.\
> $\dot{q}$ is the join velocitiy vector.\
> $\ddot{q}$ is the joint acceleration vector. 



"""

# X_dot_dot is tthe end effector acceleration vector
# X_dot is the end effector velocity vector
# q_dot is the joint velocity vector
# q_dot_dot is the acceleration vector
# J is jacobian matrix i.e. J(q)

# Function for determining joint velocities
def joint_vel(X_dot,J):
  pseudo_inverse_of_J = np.linalg.inv(np.transpose(J)@J)@np.transpose(J)
  J_inv = pseudo_inverse_of_J
  q_dot = J_inv @ X_dot
  return q_dot

# Function for determining joint accelerations
def joint_acc(X_dot,X_dot_dot,J):
  pseudo_inverse_of_J = np.linalg.inv(np.transpose(J)@J)@np.transpose(J)
  J_inv = pseudo_inverse_of_J
  q_dot = J_inv @ X_dot
  b = X_dot_dot - sp.diff(J,t)@q_dot
  q_dot_dot = J_inv @ b
  return q_dot_dot

"""## **Solution 6**
For spherical wrists, a generalised code is developed to obtain Euler angles given the rotation matrix ($R_3^6$). Let's consider $\phi,\theta, \psi$ as Euler angles.

\begin{equation*}
R_3^6 = 
\begin{bmatrix}
c_{\phi}c_{\theta}c_{\psi}-s_{\phi}s_{\psi} & -c_{\phi}c_{\theta}s_{\psi}-s_{\phi}c_{\psi} & c_{\phi}s_{\theta} \\
s_{\phi}c_{\theta}c_{\psi}+c_{\phi}s_{\psi} & -s_{\phi}c_{\theta}s_{\psi}+c_{\phi}c_{\psi} & s_{\phi}s_{\theta} \\
-s_{\theta}c_{\psi} & s_{\theta}s_{\psi} & c_{\theta}
\end{bmatrix} 
= \begin{bmatrix}
u_{11} & u_{12} & u_{13} \\
u_{21} & u_{22} & u_{23} \\
u_{31} & u_{32} & u_{33}
\end{bmatrix} 
\end{equation*}
"""

def euler_angles(R):
  u11 = R[0,0] 
  u12 = R[0,1] 
  u13 = R[0,2]
  u21 = R[1,0] 
  u22 = R[1,1] 
  u23 = R[1,2]
  u31 = R[2,0] 
  u32 = R[2,1]
  u33 = R[2,2]

  if ((u13==0) & (u23==0)):
    if (u33==1):
      theta = 0
      phi_psi = math.atan(u21/u11)
      print('\nPhi and Psi has infinite pairs of solution\n Phi + Psi = ',phi_psi)
      
    else:
      theta = 0
      phi_psi = math.atan(u12/u11)
      print('\nPhi and Psi has infinite pairs of solution\n Phi - Psi = ',phi_psi)

  else:
    theta = math.atan(((1-u33**2)**0.5)/u33)
    phi = abs(math.atan(u23/u13))
    psi = math.atan(u32/-u31)
    print('\nphi = ',phi)
    print('\ntheta = ',theta)
    print('\npsi = ',psi)
    
  return theta

